import React from 'react';
import {useState} from 'react';
import './index.css';

const App = ()=>{
  const [value,setValue] = useState(0);

  const btnDecrement = ()=>{
    setValue((oldValue)=>{
        return oldValue;
    })
  }

  const btnIncrement = ()=>{
    setValue((oldValue)=>{
      return oldValue;
    })
  }

  return (
    <>
    <button onClick={btnDecrement}>-</button>
      <h1>{value}</h1>
    <button onClick={btnIncrement}>+</button>
    </>
  )
}

export default App;
